55E7410B-1019-416E-B496-291F3EF4DECB.source:
this.material.metalnessMap.wrapS = THREE.RepeatWrapping;
this.material.metalnessMap.wrapT = THREE.RepeatWrapping;

this.material.normalMap.wrapS = THREE.RepeatWrapping;
this.material.normalMap.wrapT = THREE.RepeatWrapping;
this.material.normalMap.repeat.set( 180, 10 );

this.material.alphaMap.wrapS = THREE.RepeatWrapping;
this.material.alphaMap.wrapT = THREE.RepeatWrapping;

function update( event ) {

	var time = event.time / 1000;

	this.rotation.x = time / 20;
	this.rotation.y = time / 40;

}

var light = this.getObjectByName( 'PointLight 3' );

function getPos( u, in_q, in_p, radius ) {

	var cu = Math.cos( u );
	var su = Math.sin( u );
	var quOverP = in_q / in_p * u;
	var cs = Math.cos( quOverP );

	var tx = radius * ( 2 + cs ) * 0.5 * cu;
	var ty = radius * ( 2 + cs ) * su * 0.5;
	var tz = radius * Math.sin( quOverP ) * 0.5;

	return new THREE.Vector3( tx, ty, tz );

}

function update( event ) {

	var time = event.time * 0.0002;

	light.position.copy( getPos( time, 3, 2, 4 ) );


}

449AB29E-5281-4B62-9771-2E6E57D32494.source:
var light = scene.getObjectByName( 'PointLight 3' );
var vector = new THREE.Vector3();

function update( event ) {

	vector.setFromMatrixPosition( light.matrixWorld );
	camera.position.copy( vector );
	camera.position.z += 1.2;
	camera.lookAt( vector );

}
